SDL_Integer GetSeed(TextFile F, SDL_Charstring Prompt)
{
  SDL_Integer Result;

  while (1) {
    Result = GetInteger(F, Prompt);
    if ((Result<=32767) && (Result>=1) && ((Result)%2==1))
      return Result;
#ifdef XMONITOR
    xPrintString("Seed should be odd integer in range 1 to 32767\n");
    *xInputPos = '\0';
#else
    printf ("Seed should be odd integer in range 1 to 32767\n");
#endif
  }
}

int pfread(FILE *file, char *buf, int buflen, long position)
{
#if defined (SUN5_ANSICC) || defined (SUN5_CC)
 return pread(fileno(file),buf,buflen,position);
#else
 int result;
 fseek(file, position, SEEK_SET);
 result = fread(buf, buflen,1,file);
 fseek(file, position, SEEK_SET);
 return result * buflen;
#endif
}

char *pfgets(char *buf, int buflen, FILE *file)
{
#if !defined (__BORLANDC__)
  return fgets(buf,buflen,file);
#else
  int jb=0;
  while(jb<buflen && (_rtl_read(fileno(file),(char*)(buf+jb),1)) &&
        buf[jb]!=0x0a && buf[jb]!=0x0d)
    jb++;
  if(buf[jb]==0x0d) fseek(file, ftell(file)+1, SEEK_SET);
  buf[jb] = 0;
  return jb;
#endif
}



